%BD\" title=\"\u041c\u0430\u043b\u044c\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u043e\u0440\u0434\u0435\u043d\">\u041c\u0430\u043b\u044c\u0442\u0438\u0439\u0441\u043a\u043e\u043c\u0443 \u043e\u0440\u0434\u0435\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1593_%D0%B3%D0%BE%D0%B4\" title=\"1593 \u0433\u043e\u0434\">1593<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B9%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D0%B2%D0%B5%D1%82_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u0422\u0430\u0439\u043d\u044b\u0439 \u0441\u043e\u0432\u0435\u0442 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u0422\u0430\u0439\u043d\u044b\u0439 \u0421\u043e\u0432\u0435\u0442<\/a> \u043f\u0440\u0438\u043a\u0430\u0437\u0430\u043b \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u0442\u044c \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BB%D0%BE,_%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%84%D0%B5%D1%80\" title=\"\u041c\u0430\u0440\u043b\u043e, \u041a\u0440\u0438\u0441\u0442\u043e\u0444\u0435\u0440\">\u041a\u0440\u0438\u0441\u0442\u043e\u0444\u0435\u0440\u0430 \u041c\u0430\u0440\u043b\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1595_%D0%B3%D0%BE%D0%B4\" title=\"1595 \u0433\u043e\u0434\">1595<\/a>&#160;\u2014 \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%8F%D0%B2%D0%B7%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0422\u044f\u0432\u0437\u0438\u043d\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0422\u044f\u0432\u0437\u0438\u043d\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u043e\u0437\u043d\u0430\u043c\u0435\u043d\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%88%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1590%E2%80%941595)\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u0448\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1590\u20141595)\">\u0440\u0443\u0441\u0441\u043a\u043e-\u0448\u0432\u0435\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>. \u041f\u043e \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u043c \u043c\u0438\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u044f<\/a> \u0432\u0435\u0440\u043d\u0443\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u0437\u0435\u043c\u043b\u0438, \u0443\u0442\u0440\u0430\u0447\u0435\u043d\u043d\u044b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041b\u0438\u0432\u043e\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041b\u0438\u0432\u043e\u043d\u0441\u043a\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1652_%D0%B3%D0%BE%D0%B4\" title=\"1652 \u0433\u043e\u0434\">1652<\/a>&#160;\u2014 \u0432 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u043b\u043e\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B4-%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4\" title=\"\u0420\u043e\u0434-\u0410\u0439\u043b\u0435\u043d\u0434\">\u0420\u043e\u0434-\u0410\u0439\u043b\u0435\u043d\u0434<\/a> \u043f\u0440\u0438\u043d\u044f\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0435<\/a> \u0437\u0430\u043a\u043e\u043d, \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u044e\u0449\u0438\u0439 \u0440\u0430\u0431\u0441\u0442\u0432\u043e.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1703_%D0%B3%D0%BE%D0%B4\" title=\"1703 \u0433\u043e\u0434\">1703<\/a>&#160;\u2014 30 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u043b\u043e\u0434\u043e\u043a \u043f\u043e\u0434 \u043b\u0438\u0447\u043d\u044b\u043c \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u0430 I<\/a> \u0432 \u0443\u0441\u0442\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B2%D0%B0\" title=\"\u041d\u0435\u0432\u0430\">\u041d\u0435\u0432\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B9_%D0%B2_%D1%83%D1%81%D1%82%D1%8C%D0%B5_%D0%9D%D0%B5%D0%B2%D1%8B\" title=\"\u0411\u043e\u0439 \u0432 \u0443\u0441\u0442\u044c\u0435 \u041d\u0435\u0432\u044b\">\u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0438<\/a> \u0434\u0432\u0430 \u043a\u0440\u0443\u043f\u043d\u044b\u0445 \u0448\u0432\u0435\u0434\u0441\u043a\u0438\u0445 \u043a\u043e\u0440\u0430\u0431\u043b\u044f \u00ab\u0410\u0441\u0442\u0440\u0438\u043b\u044c\u0434\u00bb \u0438 \u00ab\u0413\u0435\u0434\u0430\u043d\u00bb. \u042d\u0442\u043e \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043f\u043e\u0431\u0435\u0434\u0430 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%82%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0424\u043b\u043e\u0442\u0438\u043b\u0438\u044f\">\u0444\u043b\u043e\u0442\u0438\u043b\u0438\u0438<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%BA%D0%B0\" class=\"mw-disambig\" title=\"\u0411\u0430\u043b\u0442\u0438\u043a\u0430\">\u0411\u0430\u043b\u0442\u0438\u043a\u0435<\/a>, \u0438 \u0434\u0435\u043d\u044c \u044d\u0442\u043e\u0442 \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0441\u0447\u0438\u0442\u0430\u0442\u044c \u0434\u0430\u0442\u043e\u0439 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82_%D0%92%D0%9C%D0%A4_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442 \u0412\u041c\u0424 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1704_%D0%B3%D0%BE%D0%B4\" title=\"1704 \u0433\u043e\u0434\">1704<\/a>&#160;\u2014 \u0437\u0430\u043b\u043e\u0436\u0435\u043d \u041a\u0440\u043e\u043d\u0448\u043b\u043e\u0442, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D1%80%D1%82\" title=\"\u0424\u043e\u0440\u0442\">\u0444\u043e\u0440\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82\" title=\"\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\">\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1724_%D0%B3%D0%BE%D0%B4\" title=\"1724 \u0433\u043e\u0434\">1724<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BD%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u0440\u043e\u043d\u0430\u0446\u0438\u044f\">\u043a\u043e\u0440\u043e\u043d\u0430\u0446\u0438\u0438<\/a> \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_I\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 I\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b I<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1727_%D0%B3%D0%BE%D0%B4\" title=\"1727 \u0433\u043e\u0434\">1727<\/a>&#160;\u2014 \u043d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0418\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u0432\u0437\u043e\u0448\u0451\u043b 11-\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_II\" title=\"\u041f\u0451\u0442\u0440 II\">\u041f\u0451\u0442\u0440 II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1753_%D0%B3%D0%BE%D0%B4\" title=\"1753 \u0433\u043e\u0434\">1753<\/a>&#160;\u2014 \u0443\u043a\u0430\u0437\u043e\u043c \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u044b<\/a> \u0443\u0447\u0440\u0435\u0436\u0434\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B2%D0%BE%D1%80%D1%8F%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D1%91%D0%BC%D0%BD%D1%8B%D0%B9_%D0%B1%D0%B0%D0%BD%D0%BA\" title=\"\u0414\u0432\u043e\u0440\u044f\u043d\u0441\u043a\u0438\u0439 \u0437\u0430\u0451\u043c\u043d\u044b\u0439 \u0431\u0430\u043d\u043a\">\u0414\u0432\u043e\u0440\u044f\u043d\u0441\u043a\u0438\u0439 \u0437\u0430\u0451\u043c\u043d\u044b\u0439 \u0431\u0430\u043d\u043a<\/a> (\u0423\u043a\u0430\u0437 \u043e\u0442 23.06.1754!).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1780_%D0%B3%D0%BE%D0%B4\" title=\"1780 \u0433\u043e\u0434\">1780<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II<\/a> \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BA%D1%80%D0%B8%D0%BF%D1%82\" title=\"\u0420\u0435\u0441\u043a\u0440\u0438\u043f\u0442\">\u0440\u0435\u0441\u043a\u0440\u0438\u043f\u0442\u043e\u043c<\/a> \u043e\u043a\u043e\u043d\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%B1\" title=\"\u0413\u0435\u0440\u0431\">\u0433\u0435\u0440\u0431<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\