43\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0410\u043d\u0442\u0443\u0430\u043d \u0411\u0430\u0440\u043d\u0430\u0439<\/a> (Antoine Barnay) \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043f\u0430\u0442\u0435\u043d\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D1%84%D0%BE%D0%BD\" title=\"\u0422\u0435\u043b\u0435\u0444\u043e\u043d\">\u0442\u0435\u043b\u0435\u0444\u043e\u043d<\/a> \u0441 \u0434\u0438\u0441\u043a\u043e\u0432\u044b\u043c \u043d\u0430\u0431\u043e\u0440\u043e\u043c \u043d\u043e\u043c\u0435\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u043a\u0438\u043d\u043e\u0437\u0432\u0435\u0437\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BB%D0%BC%D0%B0%D0%B4%D0%B6,_%D0%9D%D0%BE%D1%80%D0%BC%D0%B0\" title=\"\u0422\u043e\u043b\u043c\u0430\u0434\u0436, \u041d\u043e\u0440\u043c\u0430\">\u041d\u043e\u0440\u043c\u0430 \u0422\u043e\u043b\u043c\u0430\u0434\u0436<\/a> \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u043e \u043e\u0441\u0442\u0430\u0432\u0438\u043b\u0430 \u043e\u0442\u043f\u0435\u0447\u0430\u0442\u043e\u043a \u0441\u0432\u043e\u0435\u0439 \u0441\u0442\u0443\u043f\u043d\u0438 \u043d\u0430 \u043d\u0435\u0437\u0430\u0441\u0442\u044b\u0432\u0448\u0435\u043c \u0430\u0441\u0444\u0430\u043b\u044c\u0442\u0435, \u0447\u0442\u043e \u043d\u0430\u0442\u043e\u043b\u043a\u043d\u0443\u043b\u043e \u043d\u0430 \u0438\u0434\u0435\u044e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B8%D0%B2%D1%83%D0%B4\" title=\"\u0413\u043e\u043b\u043b\u0438\u0432\u0443\u0434\">\u0413\u043e\u043b\u043b\u0438\u0432\u0443\u0434\u0435<\/a> \u0430\u043b\u043b\u0435\u0438 \u043e\u0442\u043f\u0435\u0447\u0430\u0442\u043a\u043e\u0432 \u043d\u043e\u0433 \u043a\u0438\u043d\u043e\u0437\u0432\u0451\u0437\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0440\u0430\u0441\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%85%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%BE\" title=\"\u0428\u0430\u0445\u0442\u0438\u043d\u0441\u043a\u043e\u0435 \u0434\u0435\u043b\u043e\">\u0428\u0430\u0445\u0442\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0434\u0435\u043b\u0430<\/a>\u00bb \u043e\u0431 \u0438\u043c\u0435\u0432\u0448\u0435\u043c \u043c\u0435\u0441\u0442\u043e \u0430\u043d\u0442\u0438\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u043c \u0437\u0430\u0433\u043e\u0432\u043e\u0440\u0435 \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D1%83%D0%B3%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B1%D0%B0%D1%81%D1%81%D0%B5%D0%B9%D0%BD\" class=\"mw-redirect\" title=\"\u0414\u043e\u043d\u0435\u0446\u043a\u0438\u0439 \u043a\u0430\u043c\u0435\u043d\u043d\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u044b\u0439 \u0431\u0430\u0441\u0441\u0435\u0439\u043d\">\u0414\u043e\u043d\u0431\u0430\u0441\u0441\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%9E%D0%9D-1\" title=\"\u042d\u041e\u041d-1\">\u042d\u041e\u041d-1<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u0432 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u04